import React from 'react';
import ISidebar from '../../interfaces/ISidebar';

interface Props {
  sidebar: ISidebar;
}

const Sidebar = ({ sidebar: { title } }: ISidebar) => {
  return (
    <>
      <div>
        {title}
      </div>
    </>
  )
}

export default Sidebar;
